DROP TABLE IF EXISTS `xiehua_weixin_user_public_map`;
CREATE TABLE `xiehua_weixin_user_public_map` (
  `id` int(10) unsigned NOT NULL AUTO_INCREMENT COMMENT '唯一标识',
  `creator_id` varchar(20) NOT NULL DEFAULT '' COMMENT '创建人',
  `modifier_id` varchar(20) NOT NULL DEFAULT '' COMMENT '修改人',
  `generate_time` timestamp NOT NULL DEFAULT CURRENT_TIMESTAMP COMMENT '创建时间（不能用于业务）',
  `modify_time` timestamp NOT NULL DEFAULT CURRENT_TIMESTAMP ON UPDATE CURRENT_TIMESTAMP COMMENT '修改时间（不能用于业务）',
  `create_time` datetime NOT NULL COMMENT '创建时间',
  `update_time` datetime NOT NULL COMMENT '更新时间',
  `open_id` varchar(128) NOT NULL DEFAULT '' COMMENT '微信openId',
  `weixin_uid` varchar(64) NOT NULL DEFAULT '' COMMENT '微信公众号审核通过后生成的唯一标识,对外暴露',
  `session_key` varchar(255) NOT NULL DEFAULT '' COMMENT 'session_key',
  `unionid` varchar(255) NOT NULL DEFAULT '' COMMENT '只有在用户将公众号绑定到微信开放平台帐号后',
  `extend_json` varchar(500) NOT NULL DEFAULT '' COMMENT '扩展字段',
  PRIMARY KEY (`id`) USING BTREE
) ENGINE=InnoDB AUTO_INCREMENT=299 DEFAULT CHARSET=utf8 COMMENT='微信用户关注公众号关系表';

